INSERT INTO blog_posts VALUES(9,'Howdy!','<p>Welcome to farewellcafe.com, home of Farewell - and Howdy (click the dangling "HOWDY" near the top right to switch views) - on the world wide web. Hope you have fun exploring the site, there''s a lot going on!</p>',NULL,'2025-03-27T23:00:28.313Z');
INSERT INTO blog_posts VALUES(13,'KCMA - COMMUNITY GARDEN WORKDAY WEDNESDAYS','<p><img src="data:image/jpeg;base64,"></p><p>Every Wednesday from 6 - 8 PM , Behind Farewell (6515 Stadium Dr.)</p>',NULL,'2025-04-15 07:06:55');
INSERT INTO blog_posts VALUES(14,'Now Open: Northeast Pizza','<p><img src="data:image/jpeg;base64," title="" style=""></p><p>2203 Lexington Ave., Kansas City, Missouri is now home to <strong>Northeast Pizza</strong>. The New York-style pizza joint is owned and operated by Max Popoff (Farewell Cafe), Noah Quillec (French Market), and Michael DeStefano (Verbena). Read about the origins of the shop <a href="https://us21.mailchimp.com/mctx/clicks?url=https%3A%2F%2Fwww.kcur.org%2Farts-life%2F2025-01-26%2Fpizza-kansas-city-historic-northeast-noah-quillec&amp;xid=4bf541fdd5&amp;uid=185460042&amp;iid=8ff0f0890a&amp;pool=cts&amp;v=2&amp;c=1746140365&amp;h=5cd5f44ad8e90c78b7bbaf3b9a7b227909ac5dd15aad1167466d345c2caf204d" rel="noopener noreferrer" target="_blank"><strong>here</strong></a> in a new KCUR/Startland article and click <a href="https://us21.mailchimp.com/mctx/clicks?url=https%3A%2F%2Fwww.northeastpizzakc.com%2F&amp;xid=4bf541fdd5&amp;uid=185460042&amp;iid=8ff0f0890a&amp;pool=cts&amp;v=2&amp;c=1746140365&amp;h=78d2b5b6253724b1c8119434ce0008bbbeb8c21ed7dad7424197b909704b880d" rel="noopener noreferrer" target="_blank"><strong>here</strong></a> to check out the menu, order online, and follow the shop on social media!</p><p><br></p>',NULL,'2025-05-10 12:27:53');
INSERT INTO blog_posts VALUES(15,'Farewell and Howdy t-shirts for sale!','<p><img src="data:image/jpeg;base64," title="" style=""></p><p>Our white (top two images) and black (bottom right two images) Farewell pocket tees are available at the bar for $30 and our Howdy logo tees are available for $20. Just holler at the bartender during open hours to buy yours!</p>',NULL,'2025-05-10 12:29:23');
INSERT INTO blog_posts VALUES(16,'Have you visited Howdy DIY Thrift yet?','<p><img src="data:image/jpeg;base64," title="" style=""></p><p>Come on down, meet Stanley, and browse a fun and affordable selection of clothing and accessories. Follow @<a href="https://us21.mailchimp.com/mctx/clicks?url=https%3A%2F%2Fwww.instagram.com%2Fhowdydiythrift%2F&amp;xid=4bf541fdd5&amp;uid=185460042&amp;iid=8ff0f0890a&amp;pool=cts&amp;v=2&amp;c=1746140365&amp;h=d0702b7f717c71ba5ea55b59476dd7eaa9cfa4597d3483e9012b66ff5b8bddd8" rel="noopener noreferrer" target="_blank"><strong>HowdyDIYThrift</strong></a> on Instagram to stay updated on shop hours and new arrivals!</p>',NULL,'2025-05-10 12:34:30');
